import {React} from 'react';
import "../card.css"
import {data, Vagas} from "../data.json"


export default function Card() {
  return (
    data.Vagas.map((dados) => {
      return (
        
 <div className="container" key={data.id}>
      <div className='card card1'>
        <img src={dados.logo} alt="" />
        <div className='descript-left'>
          <div className="descript-cabecalho">
            <span>{dados.company }</span> <span>{dados.new}</span> <span>{dados.featured }</span>
          </div>

          <div className="title">
            <h4>{dados.position}</h4>
          </div>

          <div className='descript-footer'>
            <span>{ dados.postedAt + " - "}</span> <span>{dados.contract + " - "}</span> <span>{dados.location }</span>
          </div>

        </div>

        <div className='descript-right'>
          <span>{dados.role}</span>  <span>{dados.level}</span>  <span>{dados.languages}</span>
        </div>

      </div >

    </div>
      )
    })

   
  );
}
